import React from 'react'

const NavBar = () => {
return (
    <div className='bg-gray-500 py-4'>
    <Link href='/sobre'>
    <a>Sobre</a> 
    </Link>
    <Link href='/cadastro'>
    <a>Cadastro</a></Link>

    </div>
)
}
export default NavBar
